contratos.objeto:
contratação direta por dispensa de licitação de empresa para prestação do Serviço Móvel, para fornecimento de acessos móveis, com assinatura de tráfego de voz e fornecimento de Chips em comodato conforme segue:

1.1. Habilitação (MIGRAÇÃO) 1 linha, SMART EMPRESAS 50GB;
1.2. Habilitação (MIGRAÇÃO) 11 linhas, SMART EMPRESA 05 GB;
1.3. Serviços gestão de voz e dados incluso no pacote;
1.4. Gestão de dispositivo MDM.

1.5. Os planos possuem possibilidade com voz ilimitada para qualquer localidade no Brasil em ligações fixo e móvel para qualquer operadora.
